@left-bgColor:#fff;  // 左侧菜单背景颜色;
@icon-link:#FF6C60;
  .menu_left{
      position: absolute;
      top:0;
      left:0;
      bottom:0;
  }
  .menu_page_top{
      width:100%;
      height: 60px;
      align-items: center;
      justify-content: space-around;
      text-transform: uppercase;
      box-sizing: border-box;
      box-shadow:0px 2px 5px 0px rgba(230,224,224,0.5);
      .logo {
          height: 36px;
          width: 36px;
          vertical-align: middle;
          display: inline-block;
      }
      .closeLogo{
          width:30px;
          height:30px;
      }
      .title{
          font-size: 22px;
          i{
              color:#FF6C60;
          }
      }
  }
.menu_page_bottom {
    width:100%;
    overflow-y: scroll;
    overflow-x: hidden;
    flex:1;
    margin-top:3px;
    z-index: 10;
    box-shadow: 0 0 10px 0 rgba(230, 224, 224, 0.5)
}
